import React from "react";
import { Link } from "react-router-dom";
import './css/Navigation.css';

const Navigation = (props) => {
    return (
        <div id='navigation'>
            <Link id='Name' to="/">유니텍오토</Link>
            <div>
                <Link to="/">Home</Link>
                <Link to="/About">About</Link>
            </div>
        </div>
    )
}

export default Navigation;
